import Navbar from "../components/Navbar";
import Menu from "../components/Menu";
import Formulaire from "../components/Formulaire";
import Input from "../components/Input";
import DashboardCard from "../components/DashboardCard";
import "../styles/newgoals.css";
const NewGoals = () => {
  return (
    <>
      <div className="gridContainer">
        <Menu />
        <Navbar titlePage="NOUVELLE OBJECTIF" />
        <div id="containerDashboardCard">
          <DashboardCard
            style={{
              gridColumn: "1 / 7",
              gridRow: "1 / 6",
              margin: "0px 100px",
            }}
          >
            <div id="containerCenterFormulaire">
              <Formulaire title="Créer un nouvel objectif :">
                <Input
                  title="Titre de l'objectif :"
                  typeInput="text"
                  styleLabel={{ position: "relative", left: "20pxpx" }}
                  styleInput={{ width: "327px", margin: "15px auto" }}
                />
                <Input title="Date de départ : " typeInput="date" />
                <Input title="Date de fin :" typeInput="date" />
                <label>Difficulté : </label>
                <select>
                  <option value="">-- Difficulté de l'objectif --</option>
                  <option value="facile">Facile</option>
                  <option value="intermediaire">Intermédiaire</option>
                  <option value="difficile">Difficile</option>
                </select>
              </Formulaire>
            </div>
          </DashboardCard>
        </div>
      </div>
    </>
  );
};
export default NewGoals;
